/**
 * Static file server
 *   request a file, get a file
 */

/********************* MIME TABLE *********************/
 
var mimes = {
    'png':  'image/png',
    'gif':  'image/gif',
    'css':  'text/css',
    'js':   'text/javascript',
    'htm':  'text/html',
    'html': 'text/html',
    'ico':  'image/vnd.microsoft.icon',
	'upload' : 'upload',
	'webp' : 'image/webp'
};
 
// Required libraries
var param = {};
var path = require("path");
var http     = require('http');
var fs       = require('fs');
var qurl = require('url');
var base64 = null;

 
/***************** Simple file server *****************/
 
// Create the server
var server = http.createServer(function (request, response) {

    if (request.method === "GET"){
		var url = decodeURIComponent(require('url').parse(request.url).pathname);
        url = '.' + url;
		console.log(url)		
		var tmp = url.lastIndexOf('.');
		ext = url.substring((tmp + 1));
		console.log('ext:'+ext);
		if(mimes[ext]=='upload')
		{
			console.log(require('url').parse(request.url,true).query.rashi);	
			base64 = require('url').parse(request.url,true).query.rashi;
			var imgExt = (base64.match('webp|png')||[])[0];
			console.log(imgExt)
			var base64Data = base64.replace(/^data:image\/(png|webp);base64,/,"")
			if(imgExt)
				fs.writeFile("./out."+imgExt, base64Data, 'base64', function(err) { console.log(err)});
			response.writeHead(200,{ 'Content-Type': mimes['html'],'Cache-Control': 'public'});
			response.end("out."+imgExt);
		}		

		path.exists(url, function(exists) {
			if(!exists) {
			  response.writeHead(404, {"Content-Type": "text/plain"});
			  response.write("404 Not Found\n");
			  response.end();
			  return;
			}
				
			if (fs.statSync(url).isDirectory()) 
				url += '/index.html';	
			
			fs.readFile(url, function(err, content) {
			  if(err) {        
				response.writeHead(500, {"Content-Type": "text/plain"});
				response.write(err + "\n");
				response.end();
				return;
			  }
			  
			  // Lookup the mimetype of the file
			  var tmp = url.lastIndexOf('.');
			  ext = url.substring((tmp + 1));
			  var mime    = mimes[ext] || 'text/plain';
		 
			  response.writeHead(200,{ 'Content-Type': mime,'Cache-Control': 'public'});
			  response.end(content,'utf-8');
			});	
		
		});	
    }
});
 
console.log('Listening at node.naukri.com')
server.listen(80, "127.0.0.1");
